import React from "react";
import TodosItem from "./todosItem";

const todosItems = (props) =>{
    
    let listItems = props.todos.map((td)=>{
        return  <TodosItem todo={td}/>
    })
    
    return <ul>
        {listItems}
    </ul>
}

export default todosItems;
